oxy_webhelp_navlinks = {"aws_s3_recovery-d22908e13247":{"topics":[{"title":"Recovery options for Amazon S3","shortdesc":"<p class=\"shortdesc\">A comparative overview of the various recovery options for Amazon S3 buckets or its         objects.<\/p>","href":"amazon_S3\/s3_recovery_options.html","attributes":{"data-id":"s3_recovery_options"},"menu":{"hasChildren":false},"tocID":"s3_recovery_options-d22908e13261","topics":[]},{"title":"Recovery of Amazon S3 buckets","shortdesc":"<p class=\"shortdesc\">You can take snapshots of an Amazon S3 bucket by using an on-demand or policy-based         snapshots. You can take an on-demand snapshot when needed and a policy-based snapshot         depending on the policies associated with the SLA Domain assigned to the S3 bucket. After             <span class=\"ph\">RSC<\/span> takes snapshots, you can recover the entire S3 bucket or recover         individual objects by using the Export or In-place recovery options.<\/p>","href":"amazon_S3\/recovery_amazon_s3_snapshots.html","attributes":{"data-id":"recovery_amazon_s3_snapshots"},"menu":{"hasChildren":false},"tocID":"recovery_amazon_s3_snapshots-d22908e13272","next":"recovery_amazon_s3_snapshots-d22908e13272"},{"title":"Recovery report for Amazon S3 buckets","shortdesc":"<p class=\"shortdesc\">If the Amazon S3 bucket backup process fails because of technical issues, you can         download a report with a list of objects that could not be completely recovered and use the         report for troubleshooting.<\/p>","href":"amazon_S3\/recovery_report_for_amazon_s3_buckets.html","attributes":{"data-id":"recovery_report_for_amazon_s3_buckets"},"menu":{"hasChildren":false},"tocID":"recovery_report_for_amazon_s3_buckets-d22908e13319","next":"recovery_report_for_amazon_s3_buckets-d22908e13319"}]}};